INSERT INTO `cms` (`entity_id`, `name`, `CMSSlug`, `description`, `image`, `content_id`, `language_slug`, `status`, `created_by`, `updated_by`, `updated_date`, `created_date`) VALUES
(3, 'About Us', 'about-us', '<div class=\"css-1vz2rsl\">\r\n<div class=\"chakra-container css-1oem911\">\r\n<div class=\"css-1tvbi2x\">\r\n<div class=\"css-utm6wp\">\r\n<h2 class=\"chakra-heading css-15loomw\">Just a decade ago</h2>\r\n\r\n<p class=\"chakra-text css-j7j87c\">Since opening our doors in June 2010, Soi 71&rsquo;s seasoned chefs along with the rest of our service oriented team is fully dedicated to providing an exceptional culinary experience. We are proud of our authentic Thai selection that is created without the use of any MSG of artificial colouring/ingredients. We have our own organic garden to grow the exotic Thai herbs that give our food its magic.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'cms/cc8396da2628a5ad3013d031a8fa2fcb.jpg', 160, 'en', 1, 1, 3, 2022, NULL),
(4, 'Privacy Policy', 'privacy-policy', '<p><strong>About this policy</strong></p>\r\n\r\n<p>Soi71 is committed to protecting your privacy and ensuring that your personal information is handled in a safe and responsible way. This policy outlines how we aim to achieve this and includes the information collected when:</p>\r\n\r\n<ul>\r\n	<li>you use our website soi71.net</li>\r\n	<li>you make a booking on our website.</li>\r\n	<li>you make enquiries on our website.</li>\r\n	<li>someone is interested in working with us.</li>\r\n</ul>\r\n\r\n<p><strong>Definition of Personal Data</strong></p>\r\n\r\n<p>Personal Data means any data that relates to an identifiable person who can be directly/indirectly identified from that data. In this case, it means personal data that you give to us via our site.</p>\r\n\r\n<p>By providing your personal data, you agree that we can use your personal data in accordance with this policy.</p>\r\n\r\n<p>Ensure you understand this policy in its entirety and take your time to read it.</p>\r\n\r\n<p>Who are we?</p>\r\n\r\n<p>Soi71 is a restaurant based in Gulshan.</p>\r\n\r\n<p>Our registered address is: Level 1 Concord Baksh Tower, 11/A Kemal Ataturk Ave, Dhaka 1213.</p>\r\n\r\n<p>How do we collect information from you?</p>\r\n\r\n<p>We collect information from you:</p>\r\n\r\n<ul>\r\n	<li>when you make a booking.</li>\r\n	<li>when you visit a restaurant (preferences, allergies etc.).</li>\r\n	<li>make an enquiry.</li>\r\n	<li>when you sign up to marketing emails.</li>\r\n</ul>\r\n\r\n<p>What type of information is collected from you?</p>\r\n\r\n<p>You may be asked to submit personal information about yourself when you make a booking. We will collect this information so we can fulfill your booking request and you may dine at our venue.</p>\r\n\r\n<p>When you make a booking:</p>\r\n\r\n<p>Soi71&nbsp;collects information such as:</p>\r\n\r\n<ul>\r\n	<li>title</li>\r\n	<li>name</li>\r\n	<li>e-mail address (used for booking confirmation and post-dining feedback emails)</li>\r\n	<li>home or work address</li>\r\n	<li>billing information taken for deposits, ticketing, or holding credit card information for</li>\r\n</ul>\r\n\r\n<p>use in the case of no-shows (where applicable)</p>\r\n\r\n<ul>\r\n	<li>telephone number</li>\r\n	<li>company name</li>\r\n	<li>dietary requests</li>\r\n	<li>marketing preferences (whether you opt-in or opt-out)</li>\r\n</ul>\r\n\r\n<p>When you dine at Soi71:</p>\r\n\r\n<ul>\r\n	<li>marketing responses (where applicable)</li>\r\n	<li>survey responses</li>\r\n	<li>current and past restaurant reservation details</li>\r\n</ul>\r\n\r\n<p>Location information:</p>\r\n\r\n<p>If you use our website, we may receive your generic location (such as city or neighborhood).</p>\r\n\r\n<p>Careers:</p>\r\n\r\n<p>You may submit your CV if you&rsquo;re interested in working for us to nashra@soi71.net. This information may include:</p>\r\n\r\n<ul>\r\n	<li>personal details</li>\r\n	<li>employment details</li>\r\n	<li>education</li>\r\n	<li>salary history</li>\r\n	<li>other relevant details</li>\r\n</ul>\r\n\r\n<p>We will use this information to assess your application. We may also keep it in our records for future reference. Please get in contact if you would no longer like us to hold your records at nashra@soi71.net</p>\r\n\r\n<p>How is your information used?</p>\r\n\r\n<p>Our use of your personal data will always have a lawful basis, either because it is necessary to complete a booking, because you have consented to our use of your personal data (e.g. by subscribing to emails), or because it is in our legitimate interests.</p>\r\n\r\n<p>We require the information outlined in the previous section to understand your needs and provide you with a better service, and in particular for the following reasons:</p>\r\n\r\n<ul>\r\n	<li>Internal record keeping.</li>\r\n	<li>Send you service emails (booking confirmation and post-dining feedback).</li>\r\n	<li>Improve our products and services.</li>\r\n	<li>Send marketing communications if you have opted in to receive them.</li>\r\n	<li>We may use the information to customize the website according to your interests.</li>\r\n</ul>\r\n\r\n<p>Who has access to your information?</p>\r\n\r\n<p>We will not sell, distribute, or lease your personal information to third parties. Any personal information we request from you will be safeguarded under current legislation.</p>\r\n\r\n<p>We will only share your information with companies if necessary to deliver services on our behalf. &nbsp;For example, service providers, third-party payment processors, and other third parties to provide our Sites and fulfil your requests, and as otherwise consented to by you or as permitted by applicable law.</p>\r\n\r\n<p>Third parties (including LIST THIRD PARTIES WHOSE CONTENT APPEARS ON THE SITE)&nbsp;whose content appears on our Site may use third-party Cookies, as detailed below. Please refer to &lsquo;Use of Cookies&rsquo; for more information on controlling Cookies. Please note that we do not control the activities of such third parties, nor the data they collect and use and advise you to check the privacy policies of any such third parties.</p>\r\n\r\n<p>You may choose to restrict the collection or use of your personal information at any point. &nbsp;Please refer to the Your Choices section of this Privacy Policy for details.</p>\r\n\r\n<p>How and where do we store data?</p>\r\n\r\n<p>We only keep your personal data for as long as we need to use it as described in this privacy policy, and/or for as long as we have your permission to keep it.</p>\r\n\r\n<p>For reservations taken through website, your data will only be stored in the Dhaka.</p>\r\n\r\n<p>Soi71 data is stored securely in own data centers.</p>\r\n\r\n<p>Profiling</p>\r\n\r\n<p>We may analyze your personal information to create a profile of your interests and preferences so that we can contact you with information relevant to you. We may make use of additional information about you when it is available from external sources to help us do this effectively.</p>\r\n\r\n<p>Your choices</p>\r\n\r\n<p>We will not contact you for marketing purposes by email, phone or text message unless you have given your prior consent. We will not pass your details to any third parties for marketing purposes unless you have expressly permitted us to. Furthermore, you can change your marketing preferences at any time by contacting us by email at nashra@soi71.net</p>\r\n\r\n<p>You have a right to request a copy of the personal information that SOI71 holds about you and have any inaccuracies corrected. Any such requests should be made to this email address: nashra@soi71.net</p>\r\n\r\n<p>You have the right to withdraw your consent to us using your personal data at any time, and to request that we delete it. We do not keep your personal data for any longer than is necessary considering the reason(s) for which it was first collected. Data will, therefore, be retained for the one year.</p>\r\n\r\n<p>Security</p>\r\n\r\n<p>Data security is very important to us, and to protect your data we have taken suitable measures to safeguard and secure data collected through our Site.</p>\r\n\r\n<p>Use of &lsquo;cookies&rsquo;</p>\r\n\r\n<p>Like many other websites, we use cookies. We use them to help you personalize your online experience.</p>\r\n\r\n<p>A cookie is a text file that is placed on your hard disk by a web page server which allows the website to recognize you when you visit. Cookies only collect data about browsing actions and patterns, and do not identify you as an individual.<br />\r\n<br />\r\nWe use cookies for the following purposes (PLEASE DELETE AS APPROPRIATE. YOU MAY NEED YOUR WEB COMPANY TO HELP WITH THIS):</p>\r\n\r\n<ul>\r\n	<li>Authentication, personalization, and security: cookies help us verify your account and device and determine when you log in, so we can make it easier for you to access the services and provide the appropriate experiences and features. We also use cookies to help prevent fraudulent use of login credentials.</li>\r\n	<li>Performance and analytics: cookies help us analyze how the services are being accessed and used and enable us to track the performance of the services. For example, we use cookies to determine if you viewed a page or opened an email. This helps us provide you with information that you find interesting. We also use cookies to provide insights regarding your End Users and your sites&rsquo; performance, such as page views, conversion rates, device information, visitor IP addresses, and referral sites.</li>\r\n	<li>Third Parties: Third Party services may use cookies to help you sign into their services from our services. We also may use third-party cookies, such as Google Analytics, to assist with analyzing performance. Any third-party cookie usage is governed by the privacy policy of the third party placing the cookie.</li>\r\n	<li>Opting Out: You can set your browser to not accept cookies, but this may limit your ability to use the services.</li>\r\n</ul>\r\n\r\n<p>Our Site may contain links to other websites. Please note that we have no control over how your data is collected, stored, or used by other websites and we advise you to check the privacy policies of any such websites before providing any data to them.</p>\r\n\r\n<p>What happens if our business changes hands?</p>\r\n\r\n<p>We may, from time to time, expand or reduce our business and this may involve the sale and/or the transfer of control of all or part of our business. Any personal data that you have provided will, where it is relevant to any part of our business that is being transferred, be transferred along with that part. The new owner or newly controlling party will, under the terms of this Privacy Policy, be permitted to use that data only for the same purposes for which it was originally collected by us.</p>\r\n\r\n<p>In the event that any of your data is to be transferred in such a manner, you will (NOT) be contacted in advance and informed of the changes. (When contacted you will (NOT, HOWEVER,) be given the choice to have your data deleted or withheld from the new owner or controller.)</p>\r\n\r\n<p>Changes to this statement</p>\r\n\r\n<p>SOI71 will occasionally update this Privacy Policy to reflect company and customer feedback. SOI71 encourages you to periodically review this statement to be informed of how SOI71 is protecting your information. This policy was last updated in February, 2022.</p>\r\n\r\n<p>Contact Information</p>\r\n\r\n<p>SOI71&nbsp;welcomes your comments regarding this Privacy Policy. If you believe that SOI71 has not adhered to this Privacy Policy, please contact SOI71 atnashra@soi71.net. We will aim to use commercially reasonable efforts to promptly determine and remedy the problem.</p>', NULL, 162, 'en', 1, 1, 2, 2022, NULL),
