(11, 'Forgot Password', 'forgot-password', 'Password Assistance', '<style media=\"screen\" type=\"text/css\">[style*=\"Roboto\"] { font-family: \'Roboto\', Arial, sans-serif !important } [style*=\"Oswald\"] { font-family: \'Oswald\', Arial, sans-serif !important } /* Linked Styles */ .body { background-color: #f7f0ee; padding: 0 !important; margin: 0 !important; display: block !important; min-width: 100% !important; width: 100% !important; background: #f7f0ee; -webkit-text-size-adjust: none; font-family: Arial, sans-serif, \'Roboto\'; } a { color: #ef5751; text-decoration: none } p { padding: 0 !important; margin: 0 !important } img { -ms-interpolation-mode: bicubic; /* Allow smoother rendering of resized image in Internet Explorer */ } .text a { color: #ef5751 !important; text-decoration: underline !important; }\r\n</style>\r\n<div class=\"body\">\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" valign=\"top\">\r\n			<table bgcolor=\"#ffffff\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mobile-shell\" width=\"650\">\r\n							<tbody>\r\n								<tr>\r\n									<td class=\"header\" style=\"width:650px; min-width:650px; font-size:0pt; line-height:0pt; padding:30px 10px 30px 10px; margin:0; font-weight:normal; Margin:0\">\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n										<tbody>\r\n											<tr>\r\n												<td align=\"center\">\r\n												<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n													<tbody>\r\n														<tr>\r\n															<td style=\"padding-bottom: 0px;\">\r\n															<div class=\"img-center\" style=\"font-size:0pt; line-height:0pt; text-align:center\"><a href=\"#\" target=\"_blank\"><img alt=\"logo\" src=\"http://eatanceweb.evincedev.com/assets/front/images/placeholder_image.jpg\" style=\"border-width: 0px; border-style: solid; width: 200px; height: 75px;\" /> </a></div>\r\n															</td>\r\n														</tr>\r\n													</tbody>\r\n												</table>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mobile-shell\" width=\"650\">\r\n							<tbody>\r\n								<tr>\r\n									<td style=\"border: 1px solid #E6CD66; padding:40px 30px; box-shadow:0 2px 3px #cccccc; border-radius: 4px; background-color:#fff;\">\r\n									<p style=\"font-size:14px; color:#343434; margin-bottom:10px;\">Hi #firstname#,</p>\r\n\r\n									<p style=\"font-size:14px; color:#343434; margin-bottom:10px;\">We received a request to reset the password associated with this email address. Click #forgotlink# to reset your password using our secure server:</p>\r\n\r\n									<p style=\"font-size:14px; color:#343434; margin-bottom:10px;\">&nbsp;</p>\r\n\r\n									<p style=\"font-size:14px; color:#343434; margin-bottom:10px;\">Team Lorem Ipsum</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\">\r\n						<table bgcolor=\"#000\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"mobile-shell\" width=\"650\">\r\n							<tbody>\r\n								<tr>\r\n									<td>\r\n									<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n										<tbody>\r\n											<tr>\r\n												<th bgcolor=\"#ffb300\" class=\"column\" style=\"font-size:0pt; line-height:0pt; padding:0; margin:0; font-weight:normal; Margin:0\">\r\n												<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n													<tbody>\r\n														<tr>\r\n															<td style=\"padding: 15px 25px 15px 25px;\">\r\n															<div class=\"text-footer-l\" style=\"color:#613b51; font-family:Arial,sans-serif, \'Roboto\'; font-size:11px; line-height:16px; text-align:center;\">Copyright &copy; 2020 LORE IPSUM</div>\r\n															</td>\r\n														</tr>\r\n													</tbody>\r\n												</table>\r\n												</th>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>', 1, 'en', 1),
